import React from 'react';
import GoalChartDifference from '../GoalChartDifference';
import GoalChartTotal from '../GoalChartTotal';
import GoalChartPassFail from '../GoalChartPassFail';

const GoalChart = ({duration, units, total, record, time, type}) => {
  return (
    <div>
      {type === 'difference' &&
        <GoalChartDifference 
          duration={duration} 
          units={units} 
          total={total} 
          record={record} 
          time={time}
        />
      }
      {type === 'total' &&
      <GoalChartTotal 
          units={units} 
          record={record} 
          time={time}
        />
      }
      {type === 'pass/fail' &&
        <GoalChartPassFail
          duration={duration} 
          units={units} 
          total={total} 
          record={record} 
          time={time}
        />
      }
    </div>
  )
}

export default GoalChart;
